import { useState } from "react";
import { getDefaultNormalizer } from "@testing-library/react"


// Const [state,setState]=useState("vijay")
function State(){
  const [id,setId]=useState("01")
  const [sur,setSur]=useState("Thummuru")
  const [name,setName]=useState("Nishanth")
  const [city,setCity]=useState("bengaluru")

  const change=()=>{
    setId("02")
    setSur("T.")
    setName("Nikhil")
    setCity("Bangalore")
  }
  
  return(
    <div>
      <h1>we are using useState()</h1>
      <h1>Id={id}</h1>
      <h2>SurName={sur}</h2>
      <h2>Name={name}</h2>
      <h2>City={city}</h2>
      <button>Update</button>
    </div>
  )
}
export default State;
